

window.addEventListener("load", function () {

    Vue.component('list-item', {
        data: function () {
            return {
                firstName: "John",
                lastName: "Doe",
                list: [],
                data: [],
                img: "data:image/png;base64,"
            }
        },
        mounted() {
            fetch("https://docs.google.com/spreadsheets/d/1DCtDFPbCudg08RWcp5ckDfQMh7GSN7WQR1EzAgVTKXQ/export?format=csv")
                .then(res => res.text())
                .then(csv => {

                    var rows = CSVToArray(csv);
                    var data = [];

                    // console.log(rows[2])

                    for (let idx = 1; idx < rows.length - 1; idx++) {
                        const element = rows[idx];
                        data.push({
                            firstName: element[3],
                            lastName: element[2],
                            email: element[1],
                            promo: element[5],
                            theme: element[7],
                            themeGuide: element[8]
                        });
                    }

                    this.list = data;
                    this.data = data;

                    // console.log(data.length)
                })
        },
        methods: {
            search(txt) {
                var result = [];
                this.data.forEach(function(item) {
                    var searchItem = (item.firstName + item.lastName).toLowerCase()
                    searchItem.indexOf(txt) > -1 ? result.push(item) : null
                    return;
                });
                this.list = result.length === 0 ? this.data : result;

            },
            onInput(e) {
                // console.log(e.target.value);
                this.search(e.target.value.toLowerCase())
            }
        },
        template: `
                <div>
                    <input @input="onInput" placeholder="Recherche" class="form-control" />
                    <div class="ann-container" v-for="item in list">
                        <div>
                            <img class="ann-image" v-bind:src="img" />
                        </div>
                        <div class="ann-data">
                            <p> {{ item.lastName }} {{ item.firstName }} </p>
                            <p> {{ item.promo }} </p>
                        </div>
                        <hr />
                    </div>
                </div>
                `,

    })

    var app = new Vue({ el: '#phonebook' })





}, false)


